import React from 'react';
import { useEffect, useState} from 'react';

const request = async () => {
  const reqOps = {
      method: 'GET',
      headers: { 'Content-Type': 'application/json' }
  };
  const response = await fetch(`http://localhost:5000`, reqOps)
  const json = await response.json()
  return json
}

function App() {
  const [data, setData] = useState([])

  const getRecords = async() => {
    let records = await request()
    setData(records)
  }  

  useEffect(() => {
    getRecords()        
  },[])  

  console.log(data)

  return (
    <div className="container">
      <table className="table">
          <thead>
            <tr>
              <th>Nombre</th>
              <th>Apellido</th>
              <th>Edad</th>          
            </tr>
          </thead>
          <tbody>        
              {
                data.length > 0 ? data.map((item,index) => {
                  <tr>          
                  <td key={index}>{item.Nombre}</td>
                  <td key={index}>{item.Apellidos}</td>
                  <td key={index}>{item.Edad}</td>
                  </tr>
                }) 
                :<tr></tr>
              }
          </tbody>
      </table>
    </div>    
  );
}

export default App;
